  "Allegations" : "FINRA RULES 2010 AND 8210, NASD RULES 2110 AND 2330(A): RESPONDENT JOHN M. NEWKIRK JR. CONVERTED $4,550 FROM CUSTOMERS.  NEWKIRK CONVERTED $4,000 FROM A CUSTOMER BY RECEIVING CASH FROM THE CUSTOMER AND ISSUING A CHECK DRAWN FROM NEWKIRK'S OUTSIDE BUSINESS TO HIS MEMBER FIRM THAT WAS RETURNED FROM INSUFFICIENT FUNDS; NEWKIRK'S MEMBER FIRM NEVER RECEIVED THE FUNDS THAT WERE INTENDED FOR DEPOSIT INTO THE CUSTOMER'S ACCOUNT TO PURCHASE SECURITIES.  NEWKIRK DEPOSITED A CUSTOMER'S $550 CHECK, WHICH HE ENDORSED, INTO A BANK ACCOUNT CONTROLLED BY HIM AND NEVER FORWARDED THE CHECK TO HIS MEMBER FIRM TO BE DEPOSITED INTO THE CUSTOMER'S ACCOUNT.  NEWKIRK ALSO PRESENTED A FALSE DOCUMENT TO A CUSTOMER THAT APPEARED TO BE AN ACCOUNT STATEMENT.  IN ADDITION, NEWKIRK FAILED TO RESPOND TO FINRA REQUESTS FOR INFORMATION AND APPEAR FOR TESTIMONY.",
